_module.service('mlSelectIntervalService', function (Private, i18n) {
  var stateFactory = Private(_state_factory.stateFactoryProvider);
  this.state = _select_interval.mlSelectIntervalService.state = stateFactory('mlSelectInterval', {
    interval: {
      display: i18n('xpack.ml.controls.selectInterval.autoInitLabel', { defaultMessage: 'Auto' }),
      val: 'auto'
    }
  });
  _select_interval.mlSelectIntervalService.initialized = true;
}).directive('mlSelectInterval', function ($injector) {
  var reactDirective = $injector.get('reactDirective');

  return reactDirective(_select_interval.SelectInterval, undefined, { restrict: 'E' });
});
